decision_conditions:
The development hereby permitted shall not be occupied until full details of the hard landscaping have been submitted to and approved in writing by the Local Planning Authority.  The hard landscaping scheme shall include, but not be limited to, details of the following:

a)	surface materials;
b)	communal roof terraces, including details of balustrading and screening to ensure a secure and sheltered environment;
c)	play spaces and any related equipment;
d)	boundary treatment; and
e)	management and maintenance.

The hard landscaping scheme shall be implemented prior to occupation of the development in accordance with the approved details and thereafter permanently maintained, to the satisfaction of the Local Planning Authority.

Reason:  In the interests of design quality, residential amenity, walking, accessibility and public safety, in accordance with policy CP3 of the Core Strategy and policy BP11 of the Borough Wide Development Policies Development Plan Document.

A)  The developer shall enter into discussions with High Speed 1 (HS1) and their engineer, Network Rail (High Speed), as soon as practicable to assist in identifying the likely effect of the development on HS1 or HS1 Property.  

B)   Prior to the start of below ground site investigations involving a borehole or trial pit deeper than one metre, details of the location and depth of site investigations including a method statement shall be submitted to and approved in writing by the Local Planning Authority in consultation with HS1.

C)   No demolition activity shall take place until the proposed methodology has been submitted to and approved in writing by the Local Planning Authority in consultation with HS1.

D)   Prior to the start of construction the following details shall be submitted to and approved in writing by the Local Planning Authority in consultation with HS1:

i)     drawings showing the vertical and horizontal distance of HS1 tunnels from the site;
ii)    a site layout plan showing proximity of the development and its services to HS1 infrastructure;
iii)   details of the design of the foundations and other works proposed below existing ground level;
iv)   engineering details of the size, depth and proximity to HS1 of any excavations;
v)    details of the size, loading and proximity to HS1 of additional ground loads such as stockpiles; and
vi)   details of the plant and equipment proposed which are likely to give rise to vibration (such as pile driving, demolition and vibro-compaction of the ground) together with predicted vibration levels.  Activities likely to cause vibration in the vicinity of HS1 infrastructure such that a peak particle velocity (PPV) of 5mm/s may be exceeded at the railway boundary will be subject to agreement in advance.  Where activities could give rise to PPV of 5mm/s or greater, a vibration and settlement monitoring regime shall be submitted to and approved in writing by the Local Planning Authority in consultation with HS1.  It shall be put in place prior to the start of works and HS1 shall be provided reasonable access to the results of monitoring.

Site investigations, demolition, excavations, construction activity and works shall be carried out in accordance with the approved details unless the Local Planning Authority in consultation with HS1 has previously agreed in writing to any change.

Reason:  Details are to be approved prior to commencement of development in order to ensure that the development does not compromise the integrity, safety, security, operation, maintenance and liabilities of HS1; to ensure that loads on, and settlement of, HS1 tunnels, structures, track and other infrastructure do not prejudice the safety or operation of HS1; to ensure that the stability HS1 tunnels, structures, track and other infrastructure is not prejudiced; and to ensure that vibration does not prejudice the safety, operation and structural integrity of HS1.
